      <img src="path_to_your_image.jpg" alt="Profile" className="profile-image" />
    </div>
  </div>
  <div className="column">
    <div className="text-element">
      <div>Start From: â‚¹3599</div>
      <div>Goa College Package</div>
      <div>Our packages are different unique in Goa; make use of our packages in special offers.</div>
    </div>
  </div>
</div>
</div>

        {/* Second row */}
        <div className="text-row">
          <div className="text-element">Text 4</div>
          <div className="text-element">Text 5</div>
          <div className="text-element">Text 6</div>
